try {
    const couchdb = global.get('couchdb');

    let { date, ident, geofencing } = msg.payload;
    let [nik, device, imei] = ident;
    couchdb.view('transactions', 'filter', 'by-harvester-date', {
        key: [ident[0], date]
    }).then(res => {
        let rs = res.data.rows?.map(x => x.value);
        geofencing.forEach(geof => {
            let { psm, estate, division, block, tree, timestamp, event } = geof;
            let transaction = rs.find(x => x.treeID == tree);
            let isHarvested = Number(event) > 0;
            if (!transaction) {
                rs.push({
                    treeID: tree,
                    psm: psm,
                    estate: estate,
                    division: division,
                    block: block,
                    harvester: nik,
                    harvested: Number(event),
                    lastHarvested: (isHarvested) ? new Date(timestamp) : null,
                    visited: 1,
                    lastVisited: new Date(timestamp),
                    createdBy: "system",
                    createdDate: new Date(),
                    modifiedBy: "system",
                    modifiedDate: new Date(),
                });
            } else {
                if (isHarvested) {
                    transaction.harvested += Number(event);
                    transaction.lastHarvested = new Date(timestamp);
                }
                transaction.visited++;
            }
        });

        couchdb.bulk('transactions', rs).then(res => {
            node.send({
                payload: res.data
            });
        }, (err) => {
            node.send({
                payload: ori,
                error: err
            })
        });
        node.send(msg);
    }, (err) => {
        node.send({
