let payload = msg.payload;

const chunkSize = 1000;
const delayBetweenChunks = 1000;

function processArrayWithDelay(startIndex) {
  const endIndex = Math.min(startIndex + chunkSize, payload.length);
  const chunk = payload.slice(startIndex, endIndex);

  node.send({
    payload: chunk
  });

  if (endIndex < payload.length) {
    setTimeout(() => {
      processArrayWithDelay(endIndex);
    }, delayBetweenChunks);
  }
}

