const redisTS = global.get('redisTS');
let ori = msg.payload;

redisTS.commands([['keys', 'wt:*']]).then(rs => {
    let wtKeys = rs.data[0];
    let payload = msg.payload;
    let suffix = ['deviceDatetime', 'latitude', 'longitude', 'altitude', 'speed', 'event', 'battery'];
    let addCommands = [];
    let createPayload = [];

    for (const rec of payload) {
        let { deviceID, deviceDatetime, latitude, longitude, altitude, event, speed, battery } = rec;
        if (deviceDatetime && deviceDatetime != null && deviceDatetime != "") {
            suffix.forEach(suf => {
                if (!wtKeys.includes(`wt:${deviceID}:${suf}`) && createPayload.find(x => x.key == `wt:${deviceID}:${suf}`) == undefined) {
                    createPayload.push({
                        key: `wt:${deviceID}:${suf}`,
                        retention: 0,
                        duplicatePolicy: (suf != 'event') ? 'LAST' : 'SUM',
                        labels: ['type', 'worker-tracker', 'deviceID', deviceID, 'topic', suf],
                        encoding: 'UNCOMPRESSED'
                    });
                }
            })
            addCommands.push([
                'TS.ADD',
                `wt:${deviceID}:deviceDatetime`,
                new Date(deviceDatetime).getTime().toString(),
                new Date(deviceDatetime).getTime().toString()
            ]);
            addCommands.push([
                'TS.ADD',
                `wt:${deviceID}:latitude`,
                new Date(deviceDatetime).getTime().toString(),
                parseFloat(latitude).toString()
            ]);
            addCommands.push([
                'TS.ADD',
                `wt:${deviceID}:longitude`,
                new Date(deviceDatetime).getTime().toString(),
                parseFloat(longitude).toString()
            ]);
            addCommands.push([
                'TS.ADD',
                `wt:${deviceID}:altitude`,
                new Date(deviceDatetime).getTime().toString(),
                parseFloat(altitude).toString()
            ]);
            addCommands.push([
                'TS.ADD',
                `wt:${deviceID}:speed`,
                new Date(deviceDatetime).getTime().toString(),
                parseFloat(speed).toString()
            ]);
            addCommands.push([
                'TS.ADD',
                `wt:${deviceID}:event`,
                new Date(deviceDatetime).getTime().toString(),
                parseFloat(event).toString()
            ]);
            addCommands.push([
                'TS.ADD',
                `wt:${deviceID}:battery`,
                new Date(deviceDatetime).getTime().toString(),
                parseFloat(battery).toString()
            ]);
        }
    }

    redisTS.tsCreate(createPayload).then(createRS => {
        msg.payload = addCommands;
        node.send(msg);
    }, (err) => {
        node.send({
